function formatDateTime(t){const o=new Date(t),n=o.getFullYear(),e=String(o.getMonth()+1).padStart(2,"0"),i=String(o.getDate()).padStart(2,"0"),a=String(o.getHours()).padStart(2,"0"),c=String(o.getMinutes()).padStart(2,"0"),s=String(o.getSeconds()).padStart(2,"0");return`${n}-${e}-${i} ${a}:${c}:${s}`}const plugin=(t,o)=>{let n=o.config.lastModifiedText||"";const e=o.config.repo;t.beforeEach(t=>{const{file:i,path:a}=o.route;if(o.config.lastModifiedConfig){const t=o.config.lastModifiedConfig;n=t.reg.test(a)?t.en:t.zh}const c=`https://api.github.com/repos/${e}/commits?path=${i}`;return fetch(c,{method:"GET"}).then(t=>t.json()).then(t=>{const o=t[0].commit.committer.date,a=`https://github.com/${e}/commits/main/${i}`,c=formatDateTime(o),s=`\n          <blockquote>\n           <a href="${a}" target="_blank" style="color: #858585">${n+c}</a>\n           </blockquote>\n          `;document.getElementById("last-modified").innerHTML=s}),t+'<span id="last-modified"></span>'})};window.$docsify=window.$docsify||{},window.$docsify.plugins=(window.$docsify.plugins||[]).concat(plugin);